import React, { useEffect } from "react";

import { makeStyles } from "@material-ui/styles";
import Paper from "@material-ui/core/Paper";
import Grid from "@material-ui/core/Grid";
import Box from "@material-ui/core/Box";
import Typography from "@material-ui/core/Typography";
import { Link } from "react-router-dom";

import Footer from "../components/footer";
import GetWindow from "../components/getWindow";

import background from "../assets/bgServices.png";

const useStyles = makeStyles((theme) => ({
  articleContainer: {
    marginTop: "8vh",
    justifyContent: "center",
    alignItems: "center",
    verticalAlign: "center",
  },
  servicesBox: {
    marginTop: "5.5em",
    marginRight: "2em",
    marginLeft: "2em",
    marginBottom: "5.5em",
    justifyContent: "center",
    alignItems: "center",
    display: "flex",
    flexWrap: "wrap",
  },
  typeTitle: {
    color: theme.palette.common.gray,
    fontSize: "3em",
    fontFamily: "Lato",
    fontWeight: 500,
  },
  typeSubTitle: {
    color: theme.palette.common.gray,
    fontSize: "1.5em",
    fontFamily: "Lato",
    fontWeight: 500,
  },
  type: {
    color: theme.palette.common.gray,
    fontSize: "1.5em",
    fontFamily: "Lato",
    fontWeight: 0,
  },
  divLineTitle: {
    width: "75%",
    color: theme.palette.common.blue,
    backgroundColor: theme.palette.common.blue,
    height: 1,
  },
  divLine: {
    width: "75%",
    color: theme.palette.common.blue,
    backgroundColor: theme.palette.common.blue,
    height: 1,
  },
}));

const NotFound = () => {
  const classes = useStyles();
  const { width } = GetWindow();
  let articleWidth = width > 800 ? "75%" : "100%";

  useEffect(() => {
    document.body.style = `background-image: url("${background}")`;
  }, []);

  return (
    <footer>
      <Grid container spacing={2} alignItems="stretch" justifyContent="center">
        <Paper
          elevation={0}
          className={classes.articleContainer}
          style={{ width: articleWidth }}
        >
          <Box className={classes.servicesBox}>
            <hr
              className={classes.divLineTitle}
              style={{ float: "left", marginTop: "2em" }}
            />
            <Grid item style={{ textAlign: "center" }}>
              <Typography className={classes.typeTitle} component="p">
                Page Not Found
              </Typography>
            </Grid>
            <hr className={classes.divLineTitle} style={{ float: "left" }} />
          </Box>
          <Box
            className={classes.servicesBox}
            style={{ textAlign: "center", alignItems: "center" }}
            display="flex"
            flexDirection={width > 850 ? "row" : "column"}
          >
            <Typography className={classes.type} component="p">
              It looks like we coulnd't find the page you were looking for.
              Please try one of the links below:
            </Typography>
            <Typography
              className={classes.text}
              component={Link}
              to="/"
              style={{ textDecoration: "none" }}
            >
              Home |{" "}
            </Typography>
            <Typography
              className={classes.text}
              component={Link}
              to="/about"
              style={{ textDecoration: "none" }}
            >
              About Us |{" "}
            </Typography>
            <Typography
              className={classes.text}
              component={Link}
              to="/services"
              style={{ textDecoration: "none" }}
            >
              Services |{" "}
            </Typography>
            <Typography
              className={classes.text}
              component={Link}
              to="/clients"
              style={{ textDecoration: "none" }}
            >
              Clients |{" "}
            </Typography>
            <Typography
              className={classes.text}
              component={Link}
              to="/contact"
              style={{ textDecoration: "none" }}
            >
              Contact Us
            </Typography>
          </Box>
        </Paper>
        <Footer />
      </Grid>
    </footer>
  );
};

export default NotFound;
